import React from 'react';
import './Homepage.css';


type Flavor = {
  name: string;
  qty: number
}

const currFlavors: Flavor[] = [
  { name: "vanilla", qty: 4 },
  { name: "chocolate", qty: 10 },
  { name: "mint chip", qty: 3 },
  { name: "strawberry", qty: 15 },
  { name: "phish food", qty: 40 }
]

const Flavors = () => {
  return <div>
    {currFlavors.map(x => <div>We have <p className="emph">{x.qty}</p> scoops of <p className="emph">{x.name}</p> in stock</div>)}
  </div>;
}

export default Flavors;
